import { Navbar, Nav, Form, FormControl, Button } from 'react-bootstrap';

function NavigationBar({ roll, query, setQuery, queryUbica, setQueryUbica }) {
{/* <NavBar roll={roll} query={query} setQuery={setQuery} queryUbica={queryUbica} setQueryUbica={setQueryUbica}/> */}

  const SearchClick = (event) => {
    setQuery(event.target.value);
  };

  const SearchUbicaClick = (event) => {
    setQueryUbica(event.target.value);
  };

  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand href="#home">Logo</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#link">Link</Nav.Link>
        </Nav>
        <Form inline className="mx-auto">
          <FormControl type="text" placeholder="Search" className="mr-sm-2" value={query}  />
          <Button variant="outline-success" onClick={SearchClick}>Search</Button>
          <FormControl type="text" placeholder="Search" className="mr-sm-2 mt-2" value={queryUbica}  />
          <Button variant="outline-success" onClick={SearchUbicaClick}>Search</Button>
        </Form>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default NavigationBar;
